<!doctype html>
<html lang="en">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width,initial-scale=1" />
<title>DCF77 — Histogram visualizer</title>
<style>
  body{font-family:system-ui,Segoe UI,Roboto,Helvetica,Arial;margin:18px;background:#f7f7fb;color:#111}
  h1{font-size:18px;margin:0 0 8px}
  .row{display:flex;gap:12px;align-items:center;margin:8px 0}
  textarea{width:100%;height:120px;font-family:monospace;padding:8px;box-sizing:border-box}
  label{font-size:13px}
  input[type=number]{width:90px}
  #canvasWrap{background:white;padding:12px;border-radius:8px;box-shadow:0 6px 20px rgba(20,20,40,0.06);}
  canvas{width:1024px;height:400px;border:1px solid #eee;background:linear-gradient(180deg,#ffffff,#fbfdff)}
  .meta{font-size:13px;color:#333;margin-top:8px}
  button{padding:8px 12px;border-radius:6px;border:1px solid #d0d7e0;background:#fff;cursor:pointer}
  button.primary{background:#2563eb;color:white;border-color:#1e4ed8}
  .small{font-size:12px;color:#555}
</style>
</head>
<body>
  <h1>DCF77 Measurement — Histogram visualizer</h1>
  <p class="small">Paste an array of measurements (hex or decimal) that alternates between <strong>period</strong> and <strong>width</strong>, starting with a period. Example: <code>[0x011C6A,0x00D962,0x011C68,0x00D960,...]</code></p>

  <textarea id="inputArea" placeholder='Paste array here...'></textarea>

  <div class="row">
    <label>Classes: <input id="classes" type="number" value="64" min="4" max="1024"></label>
    <label>Normalize? <input id="normalize" type="checkbox" checked></label>
    <button class="primary" id="renderBtn">Render histogram</button>
    <button id="downloadBtn">Download histogram JSON</button>
  </div>

  <div id="canvasWrap">
    <canvas id="histCanvas" width="1000" height="500"></canvas>
  </div>
<div class="meta" id="meta"></div>

   <div id="canvasWrap">
      <canvas id="histCanvas2" width="1000" height="500"></canvas>
   </div>
   <div class="meta" id="meta2"></div>

<script>
(function(){
  const input = document.getElementById('inputArea');
  const renderBtn = document.getElementById('renderBtn');
  const classesInput = document.getElementById('classes');
  const normalizeBox = document.getElementById('normalize');
  const canvas = document.getElementById('histCanvas');
  const canvas2 = document.getElementById('histCanvas2');
  //const ctx = canvas.getContext('2d');
  const meta = document.getElementById('meta');
  const separateBtn = document.getElementById('separateBtn');
  const downloadBtn = document.getElementById('downloadBtn');

  let splitMode = false; // false = entire dataset, true = split into period/width

  function parseArrayText(text){
    // Accept JSON array or plain CSV; allow 0x hex
    const re = /0x[0-9a-fA-F]+|\d+/g;
    const matches = text.match(re);
    if(!matches) return [];
    return matches.map(s => s.startsWith('0x')||s.startsWith('0X') ? parseInt(s,16) : parseInt(s,10));
  }

  function computeHistogram(values, bins)
  {
    const n = values.length;
    if(n===0) return null;
    let min = values[0], max = values[0];
    for(let v of values){ if(v<min) min=v; if(v>max) max=v; }
    if(min===max){ max = min+1; }
    const counts = new Array(bins).fill(0);
    for(let v of values)
    {
      // map to bin index [0,bins-1]
      const t = (v - min) / (max - min);
      let idx = Math.floor(t * bins);
      if(idx<0) idx=0; if(idx>=bins) idx=bins-1;
      counts[idx]++;
    }
    return {counts, min, max};
  }

  function drawHistogram(_canvas, hist, bins, title, normalize)
  {
    var ctx = _canvas.getContext('2d');
    // clear
    ctx.clearRect(0,0,_canvas.width,_canvas.height);
    const padLeft = 60, padRight = 20, padTop = 20, padBottom = 60;
    const W = _canvas.width, H = _canvas.height;
    const plotW = W - padLeft - padRight;
    const plotH = H - padTop - padBottom;

    // axes
    ctx.strokeStyle = '#cfd8e3'; ctx.lineWidth = 1; ctx.beginPath();
    ctx.moveTo(padLeft, padTop); ctx.lineTo(padLeft, padTop+plotH); ctx.lineTo(padLeft+plotW, padTop+plotH); ctx.stroke();

    // find max
    const maxCount = Math.max(...hist.counts);
    const scale = normalize ? 1 / maxCount : 1; // if normalize checked we'll scale to 1.0 height
    const barW = plotW / bins;

    // draw bars
    for(let i=0;i<bins;i++)
    {
      const c = hist.counts[i];
      const h = (c / maxCount) * plotH;
      const x = padLeft + i*barW;
      const y = padTop + plotH - h;
      ctx.fillStyle = '#3b82f6';
      ctx.fillRect(x+1, y, Math.max(0, barW-2), h);

      var ofs = ((hist.max-hist.min)/bins)/2;
      ctx.save(); ctx.translate(x+5,padTop+plotH+20); ctx.rotate(-Math.PI/2);
      ctx.fillStyle = '#000'; ctx.font = '12px Arial'; ctx.scale(1,0.5);
      ctx.textAlign = 'center'; ctx.fillText(Math.round(ofs+hist.min+(i*(hist.max-hist.min)/bins)), 0, 0);
      ctx.restore();
    }

    // labels
    ctx.fillStyle = '#123'; ctx.font = '8px Arial';
    ctx.textAlign = 'center';
    ctx.fillText(title, padLeft + plotW/2, padTop - 4);

    // x axis ticks: min and max
    ctx.textAlign = 'left'; ctx.font='8px Arial';
    ctx.fillText('min:' + hist.min, padLeft-35, padTop+plotH+20);
    ctx.textAlign = 'right';
    ctx.fillText('max:' + hist.max, padLeft+plotW+20, padTop+plotH+20+20);

    // y label
    ctx.save(); ctx.translate(10, padTop + plotH/2); ctx.rotate(-Math.PI/2);
    ctx.textAlign = 'center'; ctx.fillText('count (scaled to max bin)', 0, 0);
    ctx.restore();
  }

  function render(){
    const raw = input.value.trim();
    if(!raw){ meta.textContent = 'Paste measurement array into the textarea.'; ctx.clearRect(0,0,canvas.width,canvas.height); ctx.clearRect(0,0,canvas2.width,canvas2.height); return; }
    
    const arr = parseArrayText(raw);
    if(arr.length===0){ meta.textContent = 'No numbers found in input.'; return; }

    const bins = Math.max(4, Math.min(1024, parseInt(classesInput.value)||64));

    const periods = []; const widths = [];
    for(let i=0;i<arr.length;i+=2){ if(i < arr.length) periods.push(arr[i]); if(i+1 < arr.length) widths.push(arr[i+1]); }

    const histP = computeHistogram(periods, bins);
    const histW = computeHistogram(widths, bins);

    drawHistogram(canvas,histP, bins, 'Pulse periods', normalizeBox.checked);
    meta.textContent = `Samples: ${arr.length}. min=${histP.min} max=${histP.max}`;

    drawHistogram(canvas2,histW, bins, 'Pulse widths', normalizeBox.checked);
    meta2.textContent = `Samples: ${arr.length}. min=${histW.min} max=${histW.max}`;
  }

  renderBtn.addEventListener('click', render);
  
  downloadBtn.addEventListener('click', ()=>{
    const raw = input.value.trim(); if(!raw) return alert('Paste data first');
    const arr = parseArrayText(raw);
    if(arr.length===0) return alert('No numbers parsed');
    const bins = Math.max(4, Math.min(1024, parseInt(classesInput.value)||64));
    
    const periods = []; const widths = [];
    for(let i=0;i<arr.length;i+=2){ if(i < arr.length) periods.push(arr[i]); if(i+1 < arr.length) widths.push(arr[i+1]); }
    const histP = computeHistogram(periods, bins);
    const histW = computeHistogram(widths, bins);

    const out = {"pulse periods":{bins, min:histP.min, max:histP.max, counts:histP.counts}
                 ,"pulse widths":{bins, min:histW.min, max:histW.max, counts:histW.counts}};

    const blob = new Blob([JSON.stringify(out, null, 2)], {type:'application/json'});
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a'); a.href = url; a.download = 'histogram.json'; a.click(); URL.revokeObjectURL(url);
  });

  // allow Ctrl+Enter to render
  input.addEventListener('keydown', (e)=>{ if(e.ctrlKey && e.key==='Enter') render(); });

})();
</script>
</body>
</html>
